B.a_8=new A.qt("assets/images/tecEnfemagem.jpg","T\xe9cnico de Enfermagem","Torne-se um profissional que trabalha com o objetivo de prestar cuidados de sa\xfade fundamentais e assistir na recupera\xe7\xe3o de pacientes, potencializando a qualidade dos servi\xe7os de sa\xfade.","Nosso curso t\xe9cnico em Enfermagem tem como objetivo formar profissionais capacitados para atuar na promo\xe7\xe3o, preven\xe7\xe3o, recupera\xe7\xe3o e reabilita\xe7\xe3o da sa\xfade. Os t\xe9cnicos de enfermagem s\xe3o essenciais para o funcionamento eficiente de qualquer institui\xe7\xe3o de sa\xfade, pois auxiliam no atendimento direto aos pacientes, aplicam tratamentos prescritos e colaboram com a equipe multidisciplinar para garantir o bem-estar dos pacientes.\n\nAl\xe9m disso, durante o curso, o aluno desenvolver\xe1 habilidades pr\xe1ticas e te\xf3ricas que o preparar\xe3o para enfrentar os desafios di\xe1rios da profiss\xe3o, sempre mantendo um olhar humanizado e \xe9tico no cuidado com o pr\xf3ximo. O objetivo \xe9 preparar profissionais prontos para contribuir significativamente para a sa\xfade e qualidade de vida da popula\xe7\xe3o.",null)
B.a_5=new A.qt("assets/images/heart.jpg","Especializa\xe7\xe3o em Sala Vermelha","Torne-se um profissional especializado em Sala Vermelha, capacitado para atuar em situa\xe7\xf5es de emerg\xeancia e alta complexidade, garantindo atendimento r\xe1pido e eficiente para salvar vidas.","Nossa especializa\xe7\xe3o em Sala Vermelha tem como objetivo capacitar profissionais da sa\xfade para atuarem de maneira eficiente e segura em situa\xe7\xf5es de emerg\xeancia e atendimento cr\xedtico. Este curso \xe9 projetado para preparar os alunos para lidar com pacientes em estado grave, onde o tempo e a precis\xe3o s\xe3o cruciais para a sobreviv\xeancia e recupera\xe7\xe3o.\n\nOs profissionais especializados em Sala Vermelha s\xe3o treinados para executar procedimentos avan\xe7ados de suporte \xe0 vida, utilizar equipamentos de alta tecnologia e tomar decis\xf5es r\xe1pidas e eficazes sob press\xe3o. Durante o curso, os alunos desenvolver\xe3o habilidades pr\xe1ticas e conhecimentos te\xf3ricos fundamentais para enfrentar os desafios de um ambiente de alta complexidade, sempre com foco no atendimento humanizado e \xe9tico.\n\nNosso objetivo \xe9 formar especialistas prontos para agir com compet\xeancia e confian\xe7a, contribuindo para a melhoria dos servi\xe7os de urg\xeancia e emerg\xeancia e, consequentemente, para a sa\xfade e bem-estar da comunidade.",null)
B.a_7=new A.qt("assets/images/oconlogia.jpg","Especializa\xe7\xe3o em Oncologia","Torne-se um profissional especializado em Oncologia, capacitado para oferecer cuidados integrados e avan\xe7ados no tratamento e na recupera\xe7\xe3o de pacientes com c\xe2ncer, promovendo qualidade de vida e suporte cont\xednuo.","Nossa especializa\xe7\xe3o em Oncologia tem como objetivo preparar profissionais da sa\xfade para atuar de maneira especializada e abrangente no cuidado de pacientes com c\xe2ncer. Este curso oferece uma forma\xe7\xe3o aprofundada nas diversas \xe1reas da oncologia, incluindo diagn\xf3stico, tratamento, cuidados paliativos e pesquisa, com \xeanfase na abordagem multidisciplinar e personalizada do paciente oncol\xf3gico.\n\nOs profissionais especializados em Oncologia ser\xe3o capacitados para compreender as complexidades da doen\xe7a, aplicar tratamentos inovadores e fornecer suporte emocional e psicol\xf3gico tanto para os pacientes quanto para suas fam\xedlias. Durante o curso, os alunos desenvolver\xe3o habilidades pr\xe1ticas e te\xf3ricas que os preparar\xe3o para enfrentar os desafios di\xe1rios da oncologia, sempre com foco na \xe9tica, empatia e excel\xeancia no cuidado.\n\nNosso objetivo \xe9 formar especialistas prontos para atuar com compet\xeancia e sensibilidade, contribuindo significativamente para o avan\xe7o dos tratamentos oncol\xf3gicos e a melhoria da qualidade de vida dos pacientes.",null)
B.a_6=new A.qt("assets/images/hemodialise.jpg","Especializa\xe7\xe3o em Hemodi\xe1lise","Torne-se um profissional especializado em Hemodi\xe1lise, capacitado para realizar tratamentos de di\xe1lise com precis\xe3o e cuidado, contribuindo para a sa\xfade e bem-estar de pacientes com insufici\xeancia renal.","Nossa especializa\xe7\xe3o em Hemodi\xe1lise tem como objetivo capacitar profissionais da sa\xfade para atuar com expertise e precis\xe3o no manejo de pacientes com insufici\xeancia renal cr\xf4nica que necessitam de tratamento dial\xedtico. Este curso proporciona uma forma\xe7\xe3o aprofundada nas t\xe9cnicas e procedimentos de hemodi\xe1lise, incluindo a utiliza\xe7\xe3o de equipamentos especializados, monitoramento do paciente e manejo de complica\xe7\xf5es.\n\nOs profissionais formados nesta especializa\xe7\xe3o ser\xe3o treinados para realizar a hemodi\xe1lise de forma segura e eficaz, gerenciar o acesso vascular, interpretar exames laboratoriais e oferecer suporte cont\xednuo aos pacientes durante todo o tratamento. Al\xe9m disso, o curso enfatiza a import\xe2ncia da comunica\xe7\xe3o emp\xe1tica e do cuidado humanizado, promovendo um ambiente de apoio e compreens\xe3o para os pacientes e suas fam\xedlias.\n\nNosso objetivo \xe9 preparar especialistas prontos para enfrentar os desafios do tratamento dial\xedtico com compet\xeancia t\xe9cnica e sensibilidade, contribuindo para a melhoria da qualidade de vida dos pacientes com insufici\xeancia renal.",null)
